import React, { useState, useEffect } from 'react';
import Axios from 'axios';
import Button from 'react-bootstrap/Button';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

function Rental() {
  const [rentals, setRentals] = useState([]);

  useEffect(() => {
    Axios.get('http://127.0.0.1:8000/api/rentals/')
      .then((response) => {
        setRentals(response.data);
      })
      .catch((error) => {
        console.error('Error fetching rental data:', error);
      });
  }, []);

  return (
    <div>
      <Navbar expand="lg" className="bg-body-tertiary">
      <Container fluid>
        <Navbar.Brand href="#">Navbar scroll</Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: '100px' }}
            navbarScroll
          >
            <Nav.Link href="http://localhost:3000">Home</Nav.Link>
            <Nav.Link href="http://localhost:3000/rental">Rent</Nav.Link>
            <NavDropdown title="POST" id="navbarScrollingDropdown">
              <NavDropdown.Item href="http://localhost:3000">ADD For Sell</NavDropdown.Item>
              <NavDropdown.Item href="http://localhost:3000">
                ADD For Rent
              </NavDropdown.Item>
            </NavDropdown>
            <Nav.Link href="http://localhost:3000/profile">
              Profile
            </Nav.Link>
          </Nav>
          <Form className="d-flex">
            <Form.Control
              type="search"
              placeholder="Search"
              className="me-2"
              aria-label="Search"
            />
            <Button variant="outline-success">Search</Button>
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
      <h1>Rental Listings</h1>
      {rentals.map((rental) => (
        <div key={rental.id} className="rental-item">
          <h3>Vehicle Type: {rental.vehicle_type}</h3>
          <p>Phone Number: {rental.phone_number}</p>
          <p>Model: {rental.model}</p>
          <p>Description: {rental.description}</p>
          <p>Is Available: {rental.is_available ? 'Yes' : 'No'}</p>
          <img src={rental.image} alt="Vehicle" width="200" />
          {/* You can add more fields here as needed */}
        </div>
      ))}
    </div>
  );
}

export default Rental;
